import React, { useEffect, useState } from 'react';
import { View, Text, Image } from 'react-native';

function ListaDeUsuarios() {
  const [usuarios, setUsuarios] = useState([]);

  useEffect(() => {
    fetch("https://appcuidadores.azurewebsites.net/api/cuidadores", {
      method: "GET",
    })
      .then((response) => response.json())
      .then((json) => {
        setUsuarios(json);
      })
      .catch((error) => {
        console.log(error);
        alert("Erro ao inserir informações");
      });
  }, []);

  return (
    <View>
      {usuarios.map((usuario, index) => (
        <View key={index} style={{ flexDirection: 'row', alignItems: 'center', marginVertical: 10 }}>
          <Image source={{ uri: usuario.imagemUrl }} style={{ width: 50, height: 50, borderRadius: 25, marginRight: 10 }} />
          <Text>{usuario.nome}</Text>
        </View>
      ))}
    </View>
  );
}

export default ListaDeUsuarios;
